script: |
  super -f text -I q9477.spq | sort > q9477.out

inputs:
  - name: q9477.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 + - col2 NOT BETWEEN ( - col2 + 11 ) AND ( - col2 * col0 );
  - name: tab1

outputs:
  - name: q9477.out
    data: |
      51	14	96
      85	5	59
      91	47	68
